import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { ApplicationConfigService } from 'app/core/config/application-config.service';
import { Ns2HttpService } from 'app/shared/service/ns2-http.service';
import { ClaimItemDetail } from '../model/ClaimItemDetail.model';
import { EmpClaimRequest } from '../model/EmpClaimRequest.model';

@Injectable({
    providedIn: 'root'
})

export class ECClaimDataService {

    params: any;
    empClaim: EmpClaimRequest;
    claimItemDetail: ClaimItemDetail[];

    constructor(
        private applicationConfigService: ApplicationConfigService,
        private ns2Http: Ns2HttpService,
        private http: HttpClient) { }
}
